The tracking issue for this feature is: [#44874] Allows any type implementing core::ops::Receiver<Target=T> to be used as the type of self in a method belonging to T. For example, #![feature(arbitrary_self_types)] struct A; impl A { fn f(self: SmartPtr<Self>) -> i32 { 1 } // note self type
} struct SmartPtr<T>(T); impl<T> core::ops::Receiver for SmartPtr<T> { type Target = T;
} fn main() { let smart_ptr = SmartPtr(A); assert_eq!(smart_ptr.f(), 1);
} The Receiver trait has a blanket implementation for all T: Deref, so in fact things like this work too: #![feature(arbitrary_self_types)] use std::rc::Rc; struct A; impl A { fn f(self: Rc<Self>) -> i32 { 1 } // Rc implements Deref
} fn main() { let smart_ptr = Rc::new(A); assert_eq!(smart_ptr.f(), 1);
} Interestingly, that works even without the arbitrary_self_types feature but that's because certain types are effectively hard coded, including Rc. ("Hard coding" isn't quite true; they use a lang-item called LegacyReceiver to denote their special-ness in this way). With the arbitrary_self_types feature, their special-ness goes away, and custom smart pointers can achieve the same.

140.body:
With or without this feature, Rust emits an error if it finds two method candidates, like this: use std::pin::Pin;
use std::pin::pin; struct A; impl A { fn get_ref(self: Pin<&A>) {}
} fn main() { let pinned_a: Pin<&A> = pin!(A).as_ref(); let pinned_a: Pin<&A> = pinned_a.as_ref(); pinned_a.get_ref(); // error[E0034]: multiple applicable items in scope
} (this is why Rust's smart pointers are mostly carefully designed to avoid having methods at all, and shouldn't add new methods in future.) With arbitrary_self_types, we take care to spot some other kinds of conflict: #![feature(arbitrary_self_types)] use std::pin::Pin;
use std::pin::pin; struct A; impl A { fn get_ref(self: &Pin<&A>) {} // note &Pin
} fn main() { let pinned_a: Pin<&mut A> = pin!(A); let pinned_a: Pin<&A> = pinned_a.as_ref(); pinned_a.get_ref();
} This is to guard against the case where an inner (referent) type has a method of a given name, taking the smart pointer by reference, and then the smart pointer implementer adds a similar method taking self by value. As noted in the previous section, the safe option is simply not to add methods to smart pointers, and then these errors can't occur.

