The tracking issue for this feature is: #75835 The TrustZone-M feature is available for targets with the Armv8-M architecture profile (thumbv8m in their target name). LLVM, the Rust compiler and the linker are providing support for the TrustZone-M feature. One of the things provided, with this unstable feature, is the C-cmse-nonsecure-entry ABI. This ABI marks a Secure function as an entry function (see section 5.4 for details). With this ABI, the compiler will do the following: add a special symbol on the function which is the __acle_se_ prefix and the standard function name constrain the number of parameters to avoid using the Non-Secure stack before returning from the function, clear registers that might contain Secure information use the BXNS instruction to return Because the stack can not be used to pass parameters, there will be compilation errors if: the total size of all parameters is too big (for example more than four 32 bits integers) the entry function is not using a C ABI The special symbol __acle_se_ will be used by the linker to generate a secure gateway veneer. #![no_std]
