When manually implementing the Default trait for a type that has default field values, if any of these are overriden in the impl the default_overrides_default_fields lint will trigger. This lint is in place to avoid surprising diverging behavior between S { .. } and S::default(), where using the same type in both ways could result in different values. The appropriate way to write a manual Default implementation is to use the functional update syntax: #![feature(default_field_values)] struct Pet { name: String, age: i128 = 42, // impl Default for Pet will use the literal 42 for age
} impl Default for Pet { fn default() -> Pet { Pet { name: "no-name".to_string(), .. } }
}

