The tracking issue for this feature is: #43781 The doc_cfg feature allows an API be documented as only available in some specific platforms. This attribute has two effects: In the annotated item's documentation, there will be a message saying "Available on (platform) only". The item's doc-tests will only run on the specific platform. In addition to allowing the use of the #[doc(cfg)] attribute, this feature enables the use of a special conditional compilation flag, #[cfg(doc)], set whenever building documentation on your crate. This feature was introduced as part of PR #43348 to allow the platform-specific parts of the standard library be documented. #![feature(doc_cfg)] #[cfg(any(windows, doc))]
#[doc(cfg(windows))]
/// The application's icon in the notification area (a.k.a. system tray).
